import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';


class Worksnavigation extends Component{
    render(){
        const submenuLinks = this.props.submenu.map(item => (
            <div className="navbar-item" key={item.name}>
                <NavLink className="Nav_link" exact to={`/${item.name}`}>
                    {item.name}
                </NavLink>
            </div>
        ))

        return(
            <div className="navbar">
                {/* <h1>This is submenu</h1> */}
                    {submenuLinks}
            </div>
        )
    }
}

export default Worksnavigation;
